import TextField from "@material-ui/core/TextField";
import { makeStyles, Theme, withTheme, withStyles } from "@material-ui/core/styles";
import React from "react";
import { findByLabelText } from "@testing-library/dom";

const Home = () => {
  const LoginTextField = withStyles({
    root: {
      '& label.Mui-focused': {
        color: 'white',
      },
      '& .MuiOutlinedInput-root': {

        '& .MuiOutlinedInput-input':{
          color: 'white',
        },
        '& fieldset': {
          borderColor: 'white',
        },
        '&.Mui-focused fieldset': {
          borderColor: 'white',
        },
        '&:hover fieldset': {
          borderColor: 'white',
        },

      },
      '& .MuiInputLabel-root': {
        color: 'white'
      }

    },
  })(TextField);

  const useStyles = makeStyles((theme) => ({
    root: {
      display: flex,

      "& > *": {
        margin: theme.spacing(1),
      },
    },
  }));

  const classes = useStyles();

  return (
    <div>
      <form className={classes.root} noValidate autoComplete="off">
        <div class="w-96">
          <LoginTextField label="Email" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96">
          <LoginTextField label="Password" variant="outlined" fullWidth="true"/>
        </div>
      </form>
    </div>
  );
};

export default Home;
